def find_primes_between_indices(lst):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    return sorted([n for i, n in enumerate(lst[66:80]) if is_prime(n)], reverse=True)
